    This version will remain available until 11/21/2016rnrnDownload the dataset by clicking
    on the 'ZIP' button at the top right of this page.  The zip file contains an Excel
    spreadsheet listing appropriate plants recommended for sidewalks, private backyards
    and roofs that are adapted to San Francisco's unique environment, climate and habitats.
    These plants were selected with urban sustainability, biodiversity, and water conservation
    practices in mind due to their drought tolerance and provision of habitat for wildlife.
     The zip file also contains a GIS shapefile of plant community areas (areas appropriate
    for specific communities of plants, aka "phytocoenosis" or "phytocenosis").
